import React from 'react'
import BeiHai from './BeiHai'
import ForbiddenCity from './ForbiddenCity'
import GreatWall from './GreatWall'
import HouHai from './HouHai'
import LamaTemple from './LamaTemple'
import SummerPalace from './SummerPalace'
import TempleHeaven from './TempleHeaven'
import TianmenSquare from './TianmenSquare'
import { useParams } from 'react-router-dom'


export default function AttractionSinglePage() {

    let { slug } = useParams()

    let slugTransformed = slug.charAt(0).toUpperCase() + slug.slice(1, slug.indexOf('-')) + slug.charAt(slug.indexOf('-') + 1).toLocaleUpperCase() + slug.slice(slug.indexOf('-') + 2, slug.length);

    switch (slugTransformed) {
        case 'BeiHai':
            return (<BeiHai />)
            break;
        case 'ForbiddenCity':
            return (<ForbiddenCity />)
            break;
        case 'GreatWall':
            return (<GreatWall />)
            break;
        case 'HouHai':
            return (<HouHai />)
            break;
        case 'BeiHai':
            return (<BeiHai />)
            break;
        case 'LamaTemple':
            return (<LamaTemple />)
            break;
        case 'SummerPalace':
            return (<SummerPalace />)
            break;
        case 'TempleHeaven':
            return (<TempleHeaven />)
            break;
        case 'TianmenSquare':
            return (<TianmenSquare />)
            break;

        default:
            break;
    }

}
